INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (0, "", 0, 0, 4, 567, "", 2, 2, 60004, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0);
